const icon = "data:image/webp;base64,"

const banner = "data:image/png;base64,"

class CocreaFetch {
  constructor(runtime) {
    this.runtime = runtime
    this._formatMessage = runtime.getFormatMessage({
      'zh-cn': {
        'cocreaFetch.extensionName': 'Scratch Hub',
        'cocreaFetch.fetch': ' api.cocrea.world/[PATH]',
      },

      en: {
        'cocreaFetch.extensionName': "Scratch Hub",
        'cocreaFetch.fetch': 'Fetch api.cocrea.world/[PATH]',
      },
    })
  }

  formatMessage(id) {
    return this._formatMessage({
      id,
      default: id,
      description: id,
    })
  }
  getInfo() {
    return {
      id: 'cocreaFetch',
      name: 'Cocrea Fetch',
      color1: '#1c1c1c',
      color2: "#fbf304",
      color3: "#fbf304",
      blockIconURI: icon,
      blocks: [
        {
          opcode: 'fetch',
          blockType: Scratch.BlockType.REPORTER,
          text: this.formatMessage('cocreaFetch.fetch'),
          arguments: {
            PATH: {
              type: Scratch.ArgumentType.STRING,
              defaultValue: 'search/user?keyword=fath11',
            },
          }
        },
      ],
    };
  }
  async fetch(args) {
    const response = await fetch("https://api.cocrea.world/" + args.PATH);
    if (response.ok) {
      const data = await response.json();
      return JSON.stringify(data);
    } else {
      console.error('Error:', response.status);
      return null;
    }
  }
}

window.tempExt = {
  Extension: CocreaFetch,
  info: {
    name: 'cocreaFetch.extensionName',
    description: 'cocreaFetch.description',
    extensionId: 'cocreaFetch',
    iconURL: banner,
    insetIconURL: icon,
    featured: true,
    disabled: false,
    collaborator: 'fath11@Cocrea',
  },
  l10n: {
    'zh-cn': {
      'cocreaFetch.extensionName': 'Cocrea Fetch',
      'cocreaFetch.description': ' Cocrea  APIs',
    },
    en: {
      'cocreaFetch.extensionName': 'Cocrea Fetch',
      'cocreaFetch.description': 'Allows you to fetch Cocrea\'s APIs',
    },
  },
}
